import React, { useEffect, useState} from 'react';
import {Link} from 'react-router-dom';
import Navbar from './Navbar';
import useHttpGet from '../hooks/httpGet';
import useGetUserStocks from '../hooks/getUserStocks';

function Dashboard(props) {

  useEffect(()=>{
    localStorage.setItem("stocks")
  })
  const [userStock] = useGetUserStocks('http://localhost:5000/api/stocks/', props.username, []);
  
  console.log(userStock);
  

  return(
    <div>
      <Navbar/>
      <h1>Dashboard</h1>
      <h1>Logged In Status: {props.loggedIn}</h1>
      <h1>User: {props.username}</h1>
      <h1>Money: {props.money}</h1>
      <div>
        {/*map through the pokemon and display them on screen a certain way.
        Link is there to allow me to click on a name and bring it to more detail. */}
      {userStock.map(stock => (
        <p key={stock.name}>
          {stock.name}
          
        </p>
      ))}
      
      </div>
    </div>

  );
}

export default Dashboard;
